import React, { useEffect, useState } from "react";
import axios from "axios";

import "./App.css";

function App() {
  const [cpfInput, setCpfInput] = useState("");
  const [infoPaciente, setInfoPaciente] = useState(null);

  const handleSearch = async () => {
    if (!cpfInput) {
      alert("Please enter a CPF to search.");
      return;
    }

    try {
      const response = await axios.get(`/PerguntaSelecionadaPacientes?cpf=${cpfInput}`); // Adjust URL/endpoint

      if (response.data.length > 0) {
        const matchingResult = response.data.find((item) => item.cpf === cpfInput);
        if (matchingResult) {
          setInfoPaciente(matchingResult);
        } else {
          alert("No information found for the given CPF.");
        }
      } else {
        alert("No information found for the given CPF.");
      }
    } catch (error) {
      console.error(error);
      alert("An error occurred. Please try again later.");
    }
  };

  useEffect(() => {
    // No need for an effect here as search is triggered manually
  }, []);

  return (
    <div className="App">
      <div className="Colum">
        <div className="cont">
          <center>
            <h2>Selecionar Pergunta</h2>
          </center>
          <input
            type="text"
            placeholder="Enter CPF"
            value={cpfInput}
            onChange={(e) => setCpfInput(e.target.value)}
          />
          <button onClick={handleSearch}>Search</button>
          {infoPaciente && (
            <div key={infoPaciente._id}>
              <p>CPF: {infoPaciente.cpf}</p>
              <p>Nome: {infoPaciente.name}</p>
              {/* Add more infoPaciente properties as needed */}
            </div>
          )}
        </div>
      </div>
    </div>
  );
}

export default App;
